// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract calculatorandall{
    uint firstnumber;
    uint secondnumber;
    uint age;
    uint time;
    uint weather;
    uint track;

    function getfirstnum(uint _firstnum)public {
        firstnumber = _firstnum;
    }
    function getsecondnum(uint _secnum)public {
        secondnumber = _secnum;
    }

    function addition()public view returns (uint) {
        return firstnumber + secondnumber;
    }   
    function subtraction()public view returns (uint) {
        return firstnumber - secondnumber;
    }   
    function multiplication()public view returns (uint) {
        return firstnumber * secondnumber;
    }   
    function division()public view returns (uint) {
        return firstnumber / secondnumber;
    }   
    function invalid()public view returns (uint) {
        return firstnumber + secondnumber;
    }   
    

    function getage(uint _age) public{
        age = _age;
    }
    function checkage()public view returns (string memory){ 
        if (age <= 15){
            return "sorry dear you cant vote";
        } else if (age >= 16 && age <= 17) {
            return "very soon you are gonna vote";
        }
        else{
            return "You are eligible to vote";
        }
    }
    function tracktime(uint _ctime) public {
        time = _ctime;
    }
    function checktime()public view returns (string memory){
        if (time <= 12){
            return "Good Morning";
        } else if (time >= 12 && time <= 16) {
            return "Good Afternoon";
        } else if (time >= 16 && time <= 20) {
            return "Good Evening";
        } else{
            return "Good Night";
        }
    }
    function getweather(uint _wet) public {
        weather = _wet;
    }

    function checkweather()public view returns (string memory){
        if (weather <= 15){
            return "cold";
        } else if (weather >= 15 && weather <= 25) {
            return "normal";
        } else {
            return "hot";
        }
    }
    function trackup(uint _track) public {
        track = _track;
    }
    function checktrack()public view returns (string memory){
        if (track <= 8){
            return "learn till 10am";
        } else if (track >= 10 && track <= 12) {
            return "go n get food";
        } else if (track >= 12 && track <= 14) {
            return "probably read";
            } else if (track >= 14 && track <= 18) {
            return "sleep";
        } else if (track >= 19 && track <= 20) {
            return "hydrate";
        }    
        else {
            return "sleep again";
        }
    }
}

